(230, 'A91', 'Grado centesimal', 'Sinónimo: grado\nEl grado centesimal o gon —también llamado gradián (plural: gradianes) y gonio — es una unidad de medida de ángulos planos, alternativa al grado sexagesimal y al radián.', 'Unidades no recomendadas para su uso por la Oficina Internacional de Pesos y Medidas (BIPM) con sede en Francia.', '2022-01-01', '0000-00-00', 'gon', '4.00', 5, '2022-09-25 04:40:28'),
