(246, 'AJ', 'policía', '', 'Las unidades marcadas como borradas en el catálogo internacional de UNECE, serán retenidas indefinidamente en las listas de códigos. En su caso, estas unidades podrán ser reinstalado a través del proceso de mantenimiento.', '2022-01-01', '0000-00-00', '', '4.00', 5, '2022-09-25 04:40:29'),
(247, 'AK', 'Braza', 'Una braza es una unidad de longitud náutica, usada generalmente para medir la profundidad del agua. Se llama braza porque equivale a la longitud de un par de brazos extendidos, aproximadamente dos metros, ó 6 pies en el sistema de medición estadounidense. Actualmente es considerada arcaica e imprecisa.', '', '2022-01-01', '0000-00-00', 'fth', '4.00', 5, '2022-09-25 04:40:29'),
(248, 'AL', 'Línea de acceso', 'Unidad de recuento para definir el número de líneas de acceso telefónico.', '', '2022-01-01', '0000-00-00', '', '4.00', 5, '2022-09-25 04:40:29'),
(249, 'AMH', 'Amperio hora', 'Unidad de carga electrica definida por la cantidad de carga acumulada por un flujo constante de un amperio por 1 hora.', '', '2022-01-01', '0000-00-00', 'A·h', '4.00', 5, '2022-09-25 04:40:29'),
(250, 'AMP', 'Amperio', 'Es la intensidad de una corriente constante que manteniéndose en dos conductores paralelos, rectilíneos, de longitud infinita, de sección circular despreciable y situados a una distancia de un metro uno de otro en el vacío, produciría una fuerza igual a 2·10-7 newton por metro de longitud.', '', '2022-01-01', '0000-00-00', 'A', '4.00', 5, '2022-09-25 04:40:29'),
(251, 'ANN', 'Año', 'Unidad de tiempo equivalente a 365.25 días.', '', '2022-01-01', '0000-00-00', 'y', '4.00', 5, '2022-09-25 04:40:29'),
