(259, 'ASU', 'Grado alcohólico volumétrico', 'Unidad de volumen que define el grado alcohólico de un líquido (por ejemplo, alcohol, vino, cerveza, etc.), a menudo a una temperatura específica.', '', '2022-01-01', '0000-00-00', '', '4.00', 5, '2022-09-25 04:40:29'),
(260, 'ATM', 'Atmósfera estándar', 'Es un modelo de la atmósfera terrestre que permite obtener los valores de presión, temperatura, densidad y viscosidad del aire en función de la altitud. Su función es proporcionar un marco de referencia invariante para la navegación aérea y para la realización de cálculos aerodinámicos consistentes.', '', '2022-01-01', '0000-00-00', 'atm', '4.00', 5, '2022-09-25 04:40:29'),
(261, 'ATT', 'Atmósfera técnica', '', 'Unidades no recomendadas para su uso por la Oficina Internacional de Pesos y Medidas (BIPM) con sede en Francia.', '2022-01-01', '0000-00-00', 'a', '4.00', 5, '2022-09-25 04:40:29'),
