(962, 'GIA', 'Gill (us)', 'Es Unidad de volumen inglesa en el sistema imperial y en los Estados Unidos. La versión imperial usada en el UK es de 5 onzas líquidas, y es equivalente a 142,0653125 ml; mientras que en los EUA es de 4 onzas líquidas, y es equivalente a 118,29411825 ml.', '', '2022-01-01', '0000-00-00', 'gi (US)', '4.00', 5, '2022-09-25 04:40:53'),
