(970, 'GLI', 'Galón (UK)', 'Es una unidad de volumen que se emplea en los países anglófonos (especialmente Estados Unidos) o con influencia de estos (como Liberia, Guatemala, Panamá, Honduras, Nicaragua, El Salvador, Colombia y parcialmente en México), para medir volúmenes de líquidos, principalmente la gasolina y su precio. Antiguamente, el volumen de un galón dependía de lo que se midiera, y dónde. Sin embargo, en el siglo XIX existían dos definiciones de uso común: \"galón de vino\" (wine gallon) y \"galón de cerveza británico\" (ale gallon).\nEs equivalente a 3.7854 litros.', '', '2022-01-01', '0000-00-00', 'gal (UK)', '4.00', 5, '2022-09-25 04:40:54'),
(971, 'GLL', 'Galón (EUA)', 'Es una unidad de volumen que se emplea en los países anglófonos (especialmente Estados Unidos) o con influencia de estos (como Liberia, Guatemala, Panamá, Honduras, Nicaragua, El Salvador, Colombia y parcialmente en México), para medir volúmenes de líquidos, principalmente la gasolina y su precio. Antiguamente, el volumen de un galón dependía de lo que se midiera, y dónde. Sin embargo, en el siglo XIX existían dos definiciones de uso común: \"galón de vino\" (wine gallon) y \"galón de cerveza británico\" (ale gallon).', '', '2022-01-01', '0000-00-00', 'gal (US)', '4.00', 5, '2022-09-25 04:40:54'),
